import { Link } from "react-router-dom";
import { HeaderTransations, BoxTitle, BtnAvatar, MyIcash } from "./styles";
import arrowLeft from "../../assets/arrowLeft.svg";
const Transations = () => {
  return (
    <>
      <HeaderTransations>
        <BoxTitle>
          <Link to="/user-profile">
            <img src={arrowLeft} alt="voltar" />
          </Link>
          <span>Valor dispon√≠vel em carteira</span>
          <BtnAvatar>R$ 105,00</BtnAvatar>
        </BoxTitle>
        <MyIcash>
          <span>Meu iCash</span>
        </MyIcash>
      </HeaderTransations>
    </>
  );
};

export default Transations;
